  "manifest_version": 2,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "A Chrome extension that takes screenshots of a website",
  "permissions": ["activeTab"],
  "browser_action": {
    "default_popup": "popup.html"
  }
}
