Static variables are those variables that are declared with the static keyword. They are initialized only once at compile time and they retain their values between different function calls. Static variables are stored in the initialized data segment of the memory.
Static variables can be either internal or external. Internal static variables are those that are declared inside a block or a function. They are not accessible from outside the block or function. External static variables are those that are declared outside all functions. They are accessible from all the functions in the file in which they are declared.
Register variables are those variables that are declared with the register keyword. They are stored in one of the registers of the CPU. The register keyword is just a request to the compiler to store the variable in a register. It is not guaranteed that the variable will be stored in a register. The compiler may choose to store it in the memory if a register is not available.
Register variables are used to increase the speed of the program. Since registers are faster than memory, accessing a register variable is faster than accessing a memory variable. However, the number of registers in a CPU is limited, so only a limited number of variables can be declared as register variables.
